
public class Ch3OperatorEx5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
//	비교연산자
//	크다, 작다, 같다, 다르다 같은것
		
		int x = 10;
		int y = 3;
		
		System.out.println(x==y); // == 같다
		System.out.println(x!=y); //! 부정연산자
		System.out.println(x>y);
		System.out.println(x<y);
		System.out.println(x>=y);
		
	}

}
